  false,\n\t\"url\": null,\n\t\"notes\": \"Shows index traders in selected agricultural
  markets. These traders are drawn from the noncommercial and commercial categories.rrThe
  noncommercial category includes positions of managed funds, pension funds, and other
  investors that are generally seeking exposure to a broad index of commodity prices
  as an asset class in an unleveraged and passively-managed manner. The commercial
  category includes positions for entities whose trading predominantly reflects hedging
  of over-the-counter transactions involving commodity indices, for example, a swap
  dealer holding long futures positions to hedge a short commodity index exposure
  opposite institutional traders, such as pension funds.r\",\n\t\"license_title\":
